function checkLevelAll(a){let b=document.getElementsByName("smsLevel[]");for(let c=0;c<b.length;c++)b[c].checked=a}function setSmsByte(a,b){b.innerText=getSmsByte(a)+" Byte"}function getSmsByte(a){let b=0,c=a.length;for(let d=0;d<c;d++)128<a.charCodeAt(d)?b+=2:b++;return b}function httpBuildQuery(a){const b=new URLSearchParams(window.location.search);for(let c in a)b.set(c,a[c]);window.location.href="?"+b.toString()}function onSubmit(a){a.token.value=generate_token();return!0};
